//import logo from "./logo.svg";
import "./App.css";
import * as React from "react";
import { styled } from "@mui/material/styles";
import CssBaseline from "@mui/material/CssBaseline";
import SideMenu from "./components/SideMenu/SideMenu";
import TopBar from "./components/TopBar";
import PageContents from "./components/GridPageContents/PageContents";
import Container from "@mui/material/Container";
import { Box } from "@mui/system";
import { Scrollbar } from "react-scrollbars-custom";

const DrawerHeader = styled("div")(({ theme }) => ({
  display: "flex",
  alignItems: "center",
  justifyContent: "flex-end",
  padding: theme.spacing(0, 1),
  // necessary for content to be below app bar
  ...theme.mixins.toolbar,
}));




function App() {
  const [open, setOpen] = React.useState(false);

  return (
  <Scrollbar style={{ width: 10, height: 250 }}>
    <div className="App">
      <link
        rel="stylesheet"
        href="https://fonts.googleapis.com/css?family=Roboto:300,400,500,700&display=swap"
      />
      <link
        rel="stylesheet"
        href="https://fonts.googleapis.com/icon?family=Material+Icons"
      />
      <header className="App-header">
      <CssBaseline enableColorScheme />
        <TopBar setOpen={setOpen} open={open} />
        <SideMenu setOpen={setOpen} open={open} />
        <Container maxWidth="xl">
          <TopBar setOpen={setOpen} open={open} />
          <Box component="main" sx={{ flexGrow: 1, paddingLeft: 8 }}>
            <DrawerHeader />
            <PageContents />
          </Box>
        </Container>
      </header>
    </div>
    </Scrollbar>
  );
}

export default App;
